import Header from "../../components/header"
import ChatSidebar from "./ChatSideBar";
import './ChatPage.css';

const ChatPage = () =>
{
	return (
		<div className="left-container">
			<Header />
			<div className="first-line">
			<div className="sub-title">CHANNELS</div>
			<div className="icons">
				<img src="./icons/search-chat.svg" className="search_channel"></img>
				<img src="./icons/add_box.svg" className="add_box add_channel"></img>
			</div>
		</div>
		</div>
	);
};

export default ChatPage;



